const ChangeNewPassword = ({ passState, passErrorFlag, placeholder }) => {
  return (
    <>
      <PassValidate
        passState={[newPass, setNewPass]}
        passErrorFlag={[passErrorFlag, setPassErrorFlag]}
        placeholder
      />
    </>
  );
};

export default ChangeNewPassword;
